import React from "react";

let id=0;

const Recipe= ({allRecipes})=>{
    return (
        <div>
            {
                allRecipes.map(r=>(
                    <div>
                        {r.image},
                        {r.name},
                        {r.diets.map(d=>{
                            return (
                                <h5  key={id++}>{d}</h5>
                            )
                        })}
                    </div>

                ))
            }
        </div>
    )
}

export default Recipe;
